import React, { useEffect, useState } from "react";
import { sendGameData, listenForGameState, disconnectSocket } from "./socket";

// Game constants
const PADDLE_HEIGHT = 50;
const PADDLE_WIDTH = 10;
const BALL_SIZE = 10;
const GAME_WIDTH = 600;
const GAME_HEIGHT = 400;

const Game = () => {
  const [gameState, setGameState] = useState({
    ball: { x: 300, y: 200, vx: 4, vy: 4 },
    paddle1: { x: 50, y: 200 },
    paddle2: { x: 550, y: 200 },
    obstacles: [],
    score: { player1: 0, player2: 0 },
  });

  const [player, setPlayer] = useState(null); // Track which player (1 or 2)

  useEffect(() => {
    listenForGameState((updatedState) => {
      setGameState(updatedState);
    });

    return () => {
      disconnectSocket(); // Clean up on component unmount
    };
  }, []);

  // Handle paddle movement via keyboard
  useEffect(() => {
    const handleKeyPress = (event) => {
      if (!player) return;

      if (player === 1) {
        if (event.key === "ArrowUp") {
          sendGameData({ paddle1: { y: gameState.paddle1.y - 5 } });
        } else if (event.key === "ArrowDown") {
          sendGameData({ paddle1: { y: gameState.paddle1.y + 5 } });
        }
      } else if (player === 2) {
        if (event.key === "w") {
          sendGameData({ paddle2: { y: gameState.paddle2.y - 5 } });
        } else if (event.key === "s") {
          sendGameData({ paddle2: { y: gameState.paddle2.y + 5 } });
        }
      }
    };

    window.addEventListener("keydown", handleKeyPress);
    return () => window.removeEventListener("keydown", handleKeyPress);
  }, [gameState, player]);

  // Select player
  const handleJoin = (playerNumber) => {
    setPlayer(playerNumber);
    sendGameData({ player: playerNumber });
  };

  // Render game UI
  return (
    <div style={{ textAlign: "center", marginTop: "20px" }}>
      <h1>Ping Pong Game</h1>

      <div>
        {!player ? (
          <>
            <button onClick={() => handleJoin(1)}>Join as Player 1</button>
            <button onClick={() => handleJoin(2)}>Join as Player 2</button>
          </>
        ) : (
          <h2>Player {player} joined</h2>
        )}
      </div>

      <div
        style={{
          position: "relative",
          width: `${GAME_WIDTH}px`,
          height: `${GAME_HEIGHT}px`,
          backgroundColor: "#000",
          margin: "0 auto",
          border: "2px solid #fff",
        }}
      >
        <div
          style={{
            position: "absolute",
            top: `${gameState.paddle1.y}px`,
            left: `${gameState.paddle1.x}px`,
            width: `${PADDLE_WIDTH}px`,
            height: `${PADDLE_HEIGHT}px`,
            backgroundColor: "#fff",
          }}
        ></div>

        <div
          style={{
            position: "absolute",
            top: `${gameState.paddle2.y}px`,
            left: `${gameState.paddle2.x}px`,
            width: `${PADDLE_WIDTH}px`,
            height: `${PADDLE_HEIGHT}px`,
            backgroundColor: "#fff",
          }}
        ></div>

        <div
          style={{
            position: "absolute",
            top: `${gameState.ball.y}px`,
            left: `${gameState.ball.x}px`,
            width: `${BALL_SIZE}px`,
            height: `${BALL_SIZE}px`,
            borderRadius: "50%",
            backgroundColor: "#fff",
          }}
        ></div>

        {gameState.obstacles.map((obstacle, index) => (
          <div
            key={index}
            style={{
              position: "absolute",
              top: `${obstacle.y}px`,
              left: `${obstacle.x}px`,
              width: `${obstacle.size}px`,
              height: `${obstacle.size}px`,
              backgroundColor: "#f00",
            }}
          ></div>
        ))}
      </div>

      <div>
        <h2>Score</h2>
        <p>Player 1: {gameState.score.player1}</p>
        <p>Player 2: {gameState.score.player2}</p>
      </div>
    </div>
  );
};

export default Game;
